import React from 'react';
import './styles.css'

import Header from '../../components/Header'

export default function Contact() {
  return (
    <div>
      <Header />
      <div className="container-contact">
          <div>
            <h2>Contato</h2>
          </div>
        
      </div>
    </div>
  );
}
